        A = sorted(list(A))
    if len(A) == 1:
        return 1
    rep = 0
    while len(A) > 0:
        if len(A) == 1:
            return rep + 1
        LCM = True
        for i1 in A[1:]:
            if i1 % A[0] != 0:
                LCM = False
                break
        if LCM:
            A = [int(m / A[0]) for m in A]
        if A[0] == 1 and A[1] == 2:
            return rep + A[-1]
        Delta = set()
        if len(A) < 100:
            MaxWidth = len(A) * 1
        else:
            MaxWidth = int(len(A) ** 0.75 // 1)
        for W in range(1, MaxWidth + 1):
            for i1 in range(len(A) - W):
                Delta.add(abs(A[i1 + W] - A[i1]))
        Delta = sorted(list(Delta))
        A = sorted(list(set([m for m in Delta] + [A[-1] - m for m in A[:-1]])))
        rep += 1
    return rep

